INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 1, "みやこ", 14, 119901, 0, 0, 2.17, "2024/12/22 12:00:00", "ミヤコ（クリスマス）", 119901, 0, 119901, "2024/12/31 11:59:59", 450, 119901, 0, 1, 1, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 302, 0, 0, 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 5, "しずる", 6, 120001, 0, 0, 2.375, "2024/03/22 12:00:00", "シズル（ノワール）", 120001, 0, 120001, "2024/03/28 11:59:59", 450, 120001, 0, 1, 5, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 190, 0, 0, 1);
