INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 1, "めどぅーさ", 0, 0, 0, 0, 0.0, "2015/04/01 15:00:00", "メドゥーサ", 0, 0, 136601, "2030/12/31 15:00:00", 0, 136601, 0, 0, 1, "", 0, 0, 0, 0);
