INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 6, "かずまさ", 0, 191301, 0, 0, 2.22, "2015/04/01 15:00:00", "カズマサ", 191301, 0, 191301, "2030/12/31 15:00:00", 450, 191301, 0, 1, 6, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 850, 0, 0, 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 6, "こっころ", 0, 0, 0, 0, 0.0, "2015/04/01 15:00:00", "コッコロ", 0, 0, 191401, "2030/12/31 15:00:00", 0, 191401, 0, 0, 6, "", 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "しゅじんこう", 0, 100101, 0, 0, 0.0, "2015/04/01 15:00:00", "主人公", 100101, 0, 191501, "2030/12/31 15:00:00", 150, 191501, 0, 0, 0, "残されたわずかな時間で宿題を終わらせんとする\nルーセント学院の生徒。楽しい夏休みの思い出を\n守るため、山積みの宿題へと立ち向かう。", 1600, 0, 0, 0);
